	this.createElement = function(values, param) {
		var par = {};
		if (param) par = param;
		var tangentsData=[]
		values.vertex.forEach(function(){tangentsData.push(0);});
		if(values.uv){
			for(var i=0;i<values.index.length;i+=3){
				var v0_v=[values.vertex[values.index[i+0]*3+0],values.vertex[values.index[i+0]*3+1],values.vertex[values.index[i+0]*3+2]];
				var v1_v=[values.vertex[values.index[i+1]*3+0],values.vertex[values.index[i+1]*3+1],values.vertex[values.index[i+1]*3+2]];
				var v2_v=[values.vertex[values.index[i+2]*3+0],values.vertex[values.index[i+2]*3+1],values.vertex[values.index[i+2]*3+2]];

				var v0_t=[values.uv[values.index[i+0]*2+0],values.uv[values.index[i+0]*2+1]];
				var v1_t=[values.uv[values.index[i+1]*2+0],values.uv[values.index[i+1]*2+1]];
				var v2_t=[values.uv[values.index[i+2]*2+0],values.uv[values.index[i+2]*2+1]];

				var Edge1 = sys.Vector3.minus(v1_v, v0_v);
    		var Edge2 = sys.Vector3.minus(v2_v, v0_v);

				var DeltaU1 = v1_t[0] - v0_t[0];
				var DeltaV1 = v1_t[1] - v0_t[1];
				var DeltaU2 = v2_t[0] - v0_t[0];
				var DeltaV2 = v2_t[1] - v0_t[1];

				var f = 1.0 / (DeltaU1 * DeltaV2 - DeltaU2 * DeltaV1);
				var tangent=[]; //== vec3

				tangent[0]=f * (DeltaV2 * Edge1[0] - DeltaV1 * Edge2[0]);
				tangent[1]=f * (DeltaV2 * Edge1[1] - DeltaV1 * Edge2[1]);
				tangent[2]=f * (DeltaV2 * Edge1[2] - DeltaV1 * Edge2[2]);

				tangentsData[values.index[i+0]*3+0]+=tangent[0];tangentsData[values.index[i+0]*3+1]+=tangent[1];tangentsData[values.index[i+0]*3+2]+=tangent[2];
				tangentsData[values.index[i+1]*3+0]+=tangent[0];tangentsData[values.index[i+1]*3+1]+=tangent[1];tangentsData[values.index[i+1]*3+2]+=tangent[2];
				tangentsData[values.index[i+2]*3+0]+=tangent[0];tangentsData[values.index[i+2]*3+1]+=tangent[1];tangentsData[values.index[i+2]*3+2]+=tangent[2];
			}
			//console.log(tangentsData);
		}

		var ret={
			vertexBuffer: sys.createBuffer(values.vertex, "ARRAY_BUFFER"),
			normalBuffer: sys.createBuffer(values.normal, "ARRAY_BUFFER"),
			uvBuffer: values.uv ? sys.createBuffer(values.uv, "ARRAY_BUFFER") : null,
			indexBuffer: sys.createBuffer(values.index, "ELEMENT_ARRAY_BUFFER"),
			tangentBuffer:sys.createBuffer(tangentsData, "ARRAY_BUFFER"),
			len: values.index.length,
			Matrix: sys.Matrix4.get_I4(),
			NormalMatrix: sys.Matrix4.get_I4(),
			animationStart: false,
			position: par.position || [0, 0, 0],
			size: par.size || [1, 1, 1],
			rotate: par.rotate || [0, 0, 0]
		};
		ret.setMatrix=function(mat){
			var a=mat.toString().split(",").map(function(r){return parseFloat(r);});
			ret.Matrix=cloneArray(a);
			ret.NormalMatrix=cloneArray(a);
			sys.Matrix4.set_position(ret.NormalMatrix,[0,0,0]);
			sys.Matrix4.set_size(ret.NormalMatrix,[1,1,1]);
		}
		return ret;
	};
