	sys.groups=[];
	this.createGroup=function(name){
		sys.groups[name]=[];
		var data={
			Matrix:sys.Matrix4.get_I4(),
			NormalMatrix:sys.Matrix4.get_I4(),
			rotate:[0,0,0],
			size:[1,1,1],
			position:[0,0,0]
		}
		return {
			data:data,
			rotate:function(scene,axis){
				sys.Matrix4.rotateX(data.Matrix, axis[0]);
				sys.Matrix4.rotateY(data.Matrix, axis[1]);
				sys.Matrix4.rotateZ(data.Matrix, axis[2]);
				sys.Matrix4.rotateX(data.NormalMatrix, axis[0]);
				sys.Matrix4.rotateY(data.NormalMatrix, axis[1]);
				sys.Matrix4.rotateZ(data.NormalMatrix, axis[2]);
				data.rotate = [data.rotate[0] + axis[0], data.rotate[1] + axis[1], data.rotate[2] + axis[2]];
				sys.groups[name].forEach(function(a){
					a.Matrix=sys.Matrix4.mult(a.Matrix,data.Matrix);
					a.NormalMatrix=sys.Matrix4.mult(data.NormalMatrix,a.NormalMatrix);
				});
				data.Matrix=sys.Matrix4.get_I4();
				data.NormalMatrix=sys.Matrix4.get_I4();
			},
			translate:function(scene,pos){
				sys.Matrix4.translateX(data.Matrix, pos[0]);
				sys.Matrix4.translateY(data.Matrix, pos[1]);
				sys.Matrix4.translateZ(data.Matrix, pos[2]);
				data.position = [data.position[0] + pos[0], data.position[1] + pos[1], data.position[2] + pos[2]];
				sys.groups[name].forEach(function(a){
					a.Matrix=sys.Matrix4.mult(a.Matrix,data.Matrix);
				});
				data.Matrix=sys.Matrix4.get_I4();
				data.NormalMatrix=sys.Matrix4.get_I4();
			},
		}
	}
