			scene.updateDirectionShadowCamera = function () {
				var shadowSetting = scene.shadowSetting;
				//console.log(scene)
				var resMat = [];
				scene.lights.direction.forEach(function (light) {
					if (light.enable === true && light.shadowOption.enable === true) {
						light.shadow.resultMatrix = [];
						var cam_pos = light.shadowOption.camera.position;
						var view_dir = light.shadowOption.camera.direction;
						var dist = light.shadowOption.distantion;
						var nv = sys.Vector3.continueVector(cam_pos, view_dir, dist);
						//console.log(cam_pos, view_dir, dist, nv)
						for (var i = 0; i < shadowSetting.splitForDirectionLight; i++) {
							light.shadow.splits[i].dir = sys.Vector3.continueVector(cam_pos, view_dir, light.shadow.splits[i].fard / 2);
							light.shadow.splits[i].cameraPosition = sys.rotatePoint(light.directionAngle, sys.Vector3.sum(sys.Vector3.mul(light.shadow.splits[i].dir,[1,1,1]), [0, 1, 0.001]), light.shadow.splits[i].dir);
							//console.warn(light.directionAngle)
							light.shadow.splits[i].camera = sys.createCamera(light.shadow.splits[i].cameraPosition, [light.shadow.splits[i].dir], {
								type: "orthogonal",
								aspect: -1,
								width: 1,
								height: 1,
								nearPlane: 1,
								farPlane: 1
							});
							//console.log(light.shadow.splits[i].camera);
							var d = light.shadowOption.ds || 1;
							var fd = light.shadow.splits[i].neard - light.shadow.splits[i].fard;
							var dd = fd * d;
							light.shadow.splits[i].camera.setProjectionMatrix(dd, -dd, dd, -dd, fd, light.shadow.splits[i].fard);
							var q = light.shadow.splits[i].camera.resultMatrix;
							var ptOriginShadow=[0,0,0];
							ptOriginShadow = sys.Vector3.transformCoord(ptOriginShadow, q);
							
							var SM_SIZE= light.shadow.fbs[0].size[0];
							var texCoordX = ptOriginShadow[0] * SM_SIZE * 0.5;
							var texCoordY = ptOriginShadow[1] * SM_SIZE * 0.5;
							var texCoordRoundedX = Math.floor(texCoordX);
							var texCoordRoundedY = Math.floor(texCoordY);

							var dx = texCoordRoundedX - texCoordX;
							var dy = texCoordRoundedY - texCoordY;
							//console.log(dx,dy)
							dx /= SM_SIZE * 0.5;
							dy /= SM_SIZE * 0.5;
							var xRounding = sys.Matrix4.get_I4();
							sys.Matrix4.set_position(xRounding, [dx, dy, 0]);
							_Concat(light.shadow.resultMatrix, sys.Matrix4.mult(xRounding,q));
							//console.log(sys.Matrix4.mult(xRounding,q))
						}
						_Concat(resMat, light.shadow.resultMatrix);
					}
				});
				var s= scene.sceneUniforms[sys._Const_shadowMapMatrix_];
				if (resMat.toString() !== "") { s.value[s.link] = resMat;}
			};
